import React from 'react';
import { useEffect } from 'react';
import LoaderHeading from './util/LoaderHeading';
import './css/Settings.css';

function Settings() {
    useEffect(() => {
        localStorage.getItem('perPageExams');
    }, []);
    return (
        <>
            <LoaderHeading 
                description='Settings'
            />
            <div className='content-loaded'>
                <div className='settings'>
                    <div>
                        <h3 className='heading'>General</h3>
                    </div>
                    <div>
                        <h3 className='heading'>Render</h3>
                        <div className='input-block'>
                            <div className='input-container-bb'>
                                <input type='number' max={10} min={4} />
                                <label>Number of exams per page</label>
                            </div>
                        </div>
                        <div className='flex-row jc-e mt-5'>
                            <button className='btn btn-primary btn-small'>Save</button>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Settings;
